import React from "react";
import DraggableGallery from '../DraggableGallery';
import { photos } from '../../photoData'; // Adjust the path as necessary

function Testimonials() {
  return (
    <div>
      <h1>Testimonials</h1>
      <DraggableGallery photos={photos} />
    </div>
  );
}

export default Testimonials;
